import React, { useEffect, useState } from "react";
import DG from "2gis-maps";
import { WebSocket } from "ws"; // Import WebSocket from 'ws' package

export default function Test() {
  const [location, setLocation] = useState({
    latitude: 41.313723,
    longitude: 69.282787
  });

  useEffect(() => {
    // Create a WebSocket connection
    const sock = new WebSocket("ws://204.12.199.7:9999/ws");

    sock.onopen = function (event) {
      console.log("Connection successful");
      sock.send("get data");
    };

    sock.onmessage = function (event) {
      let jsonData = JSON.parse(event.data);
      let newObj = {
        latitude: Number(jsonData[0].Latitude),
        longitude: Number(jsonData[0].Longitude)
      };
      setLocation(newObj);
      console.log(newObj);
    };

    sock.onclose = function (event) {
      console.log(event.data);
      console.log("Connection closed");
    };

    let map;
    map = DG.map("map-container", {
      center: [location.latitude, location.longitude],
      zoom: 15
    });

    const icon = DG.icon({
      iconUrl:
        "https://freepngimg.com/thumb/car/75694-bird's-eye-car-top-view,plan-view-icon.png",
      iconSize: [35, 30]
    });

    // Clear previous markers
    map.eachLayer(function (layer) {
      if (layer instanceof DG.Marker) {
        map.removeLayer(layer);
      }
    });

    // Add new marker
    DG.marker([location.latitude, location.longitude], { icon: icon })
      .addTo(map)
      .bindPopup("<h4>80-q-607-pa</h4>");

    // Set max zoom level
    map.setMinZoom(3);

    // Close the WebSocket connection when the component unmounts
    return () => {
      sock.close();
    };
  }, [location.latitude, location.longitude]);

  return <div id="map-container" style={{ width: "100%", height: "100vh" }}></div>;
}
